# Özel Uygulama Bilgisi

## Uygulamanızın bilgilerini özelleştiriyorsunuz

Uygulamanızın bilgilerini `RainbowKitProvider` için `appInfo` özelliğinde geçirebilirsiniz. Özelleştirebileceğiniz özellikler, uygulamanızın adı (`appName`) ve bağlantı modundaki “Daha Fazla Bilgi” düğmesinin yönlendirdiği bağlantıdır (`learnMoreUrl`):

```tsx
import { RainbowKitProvider } from '@rainbow-me/rainbowkit';

const App = () => {
  return (
    <RainbowKitProvider
      appInfo={{
        appName: 'Rainbowkit Demo',
        learnMoreUrl: 'https://learnaboutcryptowallets.example',
      }}
      {...etc}
    >
      {/* ... */}
    </RainbowKitProvider>
  );
};
```

### Bir Feragatname Ekle

Bağlantı modunun altına gösterilecek kendi feragatnamenizi sağlayabilirsiniz. `appInfo` içindeki `disclaimer` özelliği, `Text` ve `Link` argümanlarına sahip bir `DisclaimerComponent` alır. Temalandırma sistemini devralan kendi feragatnamenizi oluşturmak için kullanabilirsiniz. TypeScript kullanıcıları için `DisclaimerComponent` türünü dışa aktarıyoruz:

```tsx
import {
  RainbowKitProvider,
  DisclaimerComponent,
} from '@rainbow-me/rainbowkit';

const Disclaimer: DisclaimerComponent = ({ Text, Link }) => (
  <Text>
    By connecting your wallet, you agree to the{' '}
    <Link href="https://termsofservice.xyz">Terms of Service</Link> and
    acknowledge you have read and understand the protocol{' '}
    <Link href="https://disclaimer.xyz">Disclaimer</Link>
  </Text>
);

const App = () => {
  return (
    <RainbowKitProvider
      appInfo={{
        appName: 'RainbowKit Demo',
        disclaimer: Disclaimer,
      }}
      {...etc}
    >
      {/* ... */}
    </RainbowKitProvider>
  );
};
```
